import React from "react";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import lightPencil from "../../assets/pencil_icon_light.png";
import darkPencil from "../../assets/pencil_icon_dark.png";
import barGraph from "../../assets/graph.png";
import singleLineGraph from "../../assets/spark_line.png";
import groupLineGraph from "../../assets/spark_lines.png";
import "./Program.css";
import FlexView from "react-flexview/lib";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

class Program extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="programCard">
        <Grid item xs={4}>
          <div className="program">
            <FlexView hAlignContent="left">
              <h3>{this.props.data.Name}</h3>
              <img
                src={lightPencil}
                alt=""
                onMouseOver={this.src = darkPencil}
              ></img>
            </FlexView>
            <p>Sales by Month</p>
            <img src={barGraph} alt=""></img>
            <FlexView hAlignContent="left">
              <div>
                <p>Total Monthly</p>
                <p>Sales</p>
              </div>
              <div>
                <p>Current</p>
                <p>{this.props.data.TotalMonthlySales}</p>
              </div>
              <div>
                <p>1 - Year</p>
                <img src={singleLineGraph} alt=""></img>
              </div>
            </FlexView>
            <button onClick={this.props.moreInfoSelected}>
              {this.props.extension ? "less" : "more"}
            </button>
            {this.props.extension ? (
              <Container fluid={true}>
                <Row>
                  <Col xs={3}>Price Name</Col>
                  <Col xs={3}>Current</Col>
                  <Col xs={3}>1 - Year</Col>
                </Row>
                <Row>
                  <Col>
                    {this.props.data.priceData.map(pricing => {
                      if (pricing.Name === "Monthly Unlimited") {
                        return (
                          <Row>
                            <Col xs={3}>{pricing.Name}</Col>
                            <Col xs={3}>{pricing.Sales}</Col>
                          </Row>
                        );
                      } else {
                        return (
                          <Row>
                            <Col xs={3}>{pricing.Name}</Col>
                            <Col xs={3}>{pricing.Sales}</Col>
                          </Row>
                        );
                      }
                    })}
                  </Col>
                  <Col xs={3}>
                    <img src={groupLineGraph} alt=""></img>
                  </Col>
                </Row>
              </Container>
            ) : null}
          </div>
        </Grid>
      </div>
    );
  }
}

export default Program;
